# clean unused icons generated by ionic lib
find ./www/svg ! -name 'md-home.svg' ! -name 'md-menu.svg' -type f -exec rm -f {} +

aws s3 cp --recursive --acl public-read ./www s3://udagram-escapism/
aws s3 cp --acl public-read --cache-control="max-age=0, no-cache, no-store, must-revalidate" ./www/index.html s3://udagram-escapism/